import React, { useEffect, useState } from 'react';

const Messages = () => {

    const [allMessages, setAllMessages] = useState([]);

    useEffect( async () => {

       const response = await axios.get("http://localhost:8010/channels/messages/60f8bfb41fd542bd56c8852f")

       console.log("messages response",response);

       setAllMessages(response.data)

    }, []);


    return (
        <div>
            {console.log("state messages; ", allMessages)}
            <ul class="list-group list-group-flush">
                <li class="list-group-item text-end">An item</li>
                <li class="list-group-item text-end">A second item</li>
                <li class="list-group-item text-end">A third item</li>
                <li class="list-group-item">A fourth item</li>
                <li class="list-group-item">And a fifth one</li>
            </ul>
        </div>
    );
}

export default Messages;
